import React from "react";
import './App.css';
import Home from './pages';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {

  const formHandler = (values) => {
    console.log(values);
  }
  return (
    <Router>
      <Switch>
        <Route path="/" component={Home} exact formHandler={formHandler} />
      </Switch>
    </Router>
  );
}

export default App;
